import React from 'react';

const Feedback = ({ feedback }) => {
    if (feedback.length === 0) {
        return null;
    }
    
    return (
        <div className="feedback">
        {feedback.map((item, index) => (
            <div key={index} className={`feedback__item feedback__item--${item.type}`}>
            {item.message}
            </div>
        ))}
        </div>
    );
}

export default Feedback;
